import React from 'react';
import "./news.module.scss"
import {Link} from "react-router-dom";
const MainNews = ({data}) => {
    return (
        <div className="news_main">
            <div className="news_main_1">
                <div className="news_main_2">
                    <div className="news_main_3">
                        <div className="w-11 h-11 relative">
                            {/* ФОТО*/}
                        </div>
                    </div>
                </div>
            </div>
            <div className="title_news">
                <div className="title_text">
                    {data[0]}
                </div>
                <div className="title_desc">
                    {data[1]}
                </div>
            </div>
            <Link to={data[2]} className="btn_news">
                <div className="btn_text">Читать больше</div>
                {/*ИКОНКА*/}
                {/*<div className="btn_"></div>*/}
            </Link>
        </div>
    );
};

export default MainNews;
